'use strict';
let MessageType = require('./MessageType.js');
//@@DocBrief("The class for for getting response on 'keep alive' message")
class KeepAliveMessage {
    error;
    requestId;
    constructor() {
        this.error = null;
        this.requestId = null;
    }
    getType() {
        return MessageType.KeepAlive;
    }
    getError() {
        return this.error;
    }
    getRequestId() {
        return this.requestId;
    }
}
module.exports = KeepAliveMessage
